window.bookSummaryJSON = "<p><b>Play&nbsp;hard.... Fight&nbsp;hard.... Love hard.</b></p> <p>The time has come for Cameron, Jason, and Asher to hang up their Rixon Raider jerseys and head off to college with the girls they love.</p> <p>But will their relationships stand the test of college life, new friendships, and most of all, football?</p> <p><i>The Endgame Is You</i> is a Rixon Raiders Epilogue. It must be listened to after the other books in the series.</p>"; 
